import React from 'react';

const SpeakersSection = () => {
  return (
    <section id="speakers" className="speakers-section">
      <h1 className="speakers-title">SPEAKERS</h1>
      <ul className="speakers-list">
        <li><b>Prof. Dipti Parasd Mukherjee</b>, Indian Statistical Institute, Kolkata, India</li>
        <li><b>Prof. Young-cheol Byun</b>, Jeju National University, Jeju Island, South Korea</li>
        <li><b>Dr. Pelin Angin</b>, Middle East Technical University, Ankara, Turkey</li>
        <li><b>Prof. Sanjoy Kumar Saha</b>, Jadavpur University, Kolkata, India</li>
        <li><b>Dr. Jeroslav Frnda</b>, University of Zilina, Zilina, Slovak Republic</li>
        <li><b>Dr. Joydeep Chandra</b>, IIT Patna, India</li>
        <li><b>Prof. Paul Kwan</b>, Central Queensland University, Brisbane, Australia</li>
        <li><b>Dr. Susmit Sannigrahi</b>, Tennessee Technological University, USA</li>
      </ul>
    </section>
  );
};

export default SpeakersSection;
